import Card from './Card'
import  products  from '../data'
function Main() {
  return (
    <div className='grid grid-cols-3 w-10/12 mx-auto gap-x-8 gap-y-16 mt '>
       {
        products.map((item)=>(
            <Card item={item}/>
        ))
       }
        
    </div>
  )
}

export default Main
